import { useParams } from "react-router-dom";
import "./CountryDetails.css";
import { useEffect, useState } from "react";
import { CountryModel } from "../../../Models/CountryModel";
import { countryService } from "../../../Services/CountryService";

export function CountryDetails(): JSX.Element {

    const params = useParams<{countryId: string}>();
    const id = +params.countryId;

    const [country, setCountry] = useState<CountryModel>();

    useEffect(() => {
        countryService.getOneCountry(prop.capital)
            .then(country => setCountry(country))
            .catch(err => console.log(err.message))
    }, [id])
    return (
        <div className="CountryDetails">
            <h1>{country.name}</h1>
            <h2>Capital: {country.capital}</h2>
            <h2>Popoulation: {country.population}</h2>
            <h2>Continent: {country.continents}</h2>
            <h2>UN Member: {country.unMember}</h2>

        </div>
    );
}
